import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Grid, Card, Paper, ButtonBase } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },

  container: {
    display: 'grid',
    gridTemplateColumns: 'repeat(12, 1fr)',
    gridGap: theme.spacing(3),
  },

  paper: {
    padding: theme.spacing(2),
    margin: 'auto',
    maxWidth: 500,
    marginBottom: theme.spacing(1),
    //backgroundColor: '#F8F8F8',
    boxShadow: '0 3px 5px 2px rgba(24,24,24, .3)'
  },

  image: {
    width: 100,
    height: 100,
    borderRadius: 50
  },
  img: {
    margin: 'auto',
    display: 'block',
    maxWidth: 100,
    maxHeight: 100,
    borderRadius: 50
  },
}));

const AttentionCard = () => {
  const classes = useStyles();
  const disability = "Diabetes";

  return (
    <div className={classes.root}>
      <Paper className={classes.paper}>
        <Grid container wrap="nowrap" spacing={2} >
          <Grid item xs={12} sm container>
            <Grid item xs container direction="column" justify="flex-start" spacing={2}>
              <Grid item xs>
                <Typography gutterBottom variant="subtitle1">
                  First and last name
                </Typography>
                <Typography variant="body2" color="textSecondary">
                  <li>In case of fatigue, check blood sugar</li>
                  <li>Provide information on </li>
                  <li>Treatment recommendation 3</li>
                </Typography>
              </Grid>

            </Grid>
            <Grid item>
              <Typography fontStyle="italic" variant="subtitle1">Disability</Typography>
            </Grid>
          </Grid>
        </Grid>
      </Paper>
    </div>
  );
}


